import "./Destination.css";
import CardDest from "../../Components/CardDest/CardDest";
import Proposer from "../../Components/proposer/proposer";

function Destination() {
    const Destination = [
        {
            id: "d1",
            title: "Korbous",
            sousTitre: "Tunisie,Nabeul",
            // image:,
        },
        {
            id: "d2",
            title: "Oued Zitoun",
            sousTitre: "Tunisie,Bizerte",
            // image:
        },
        {
            id: "d3",
            title: "Djebel Ressas",
            sousTitre: "Tunisie,Ben Arous,Nabeul",
            // image:,
        }, {
            id: "d4",
            title: "Oued Zen",
            sousTitre: "Tunisie,Jendouba",
            // image:,
        }
    ]


    return (
        <>
            <div className="container">
                <div className="container-fluid">
                    <div className="row">
                        <div className="col-md-12 text-center">
                            <p id="tn"><Proposer title="La Tunisie" ></Proposer></p>
                            <p id="dest"><Proposer subtitle="Destinatin De Camping" ></Proposer></p>
                        </div>
                    </div>
                </div>
            </div>
            <div className="row">
                <CardDest title="Korbes" subtitle="Tunisie"></CardDest>
                <CardDest title="Korbes" subtitle="Tunisie"></CardDest>
                <CardDest title="Korbes" subtitle="Tunisie"></CardDest>
                <CardDest title="Korbes" subtitle="Tunisie"></CardDest>
                <CardDest title="Korbes" subtitle="Tunisie"></CardDest>
                <CardDest title="Korbes" subtitle="Tunisie"></CardDest>
                <CardDest title="Korbes" subtitle="Tunisie"></CardDest>
                <CardDest title="Korbes" subtitle="Tunisie"></CardDest>
                <CardDest title="Korbes" subtitle="Tunisie"></CardDest>
            </div>

        </>
    );
}

export default Destination;
